import React, { useState, useEffect } from 'react';
import Navbar from './Navbar';


function Home() {
    const [doctors, setDoctors] = useState([]);

    useEffect(() => {
        async function getAllDoctors() {

            const data = {
                user: localStorage.getItem('userEmail'),
                type: 'info'
            }
            const config = {
                headers: {
                    'Content-Type': 'application/json',
                    'Accept': 'application/json'
                }
            };
            const body = JSON.stringify(data);
            const res = await axios.post(Request.doctorInfo, body, config);
            const st = res.data.doctor.day_start_time;

            if (st !== null) {

                setStartTime(res.data.doctor.day_start_time);
                setEndTime(res.data.doctor.day_end_time);
                setPeriod(res.data.doctor.appointment_slot_time);
            }
        }

        getAllDoctors();

    }, []);


    return (
        <div>
            <Navbar />
            <div className='container mt-5'>
                <div className='row'>
                    <div className='col-3'>
                        <div className='card'>
                            <img class="card-img-top w-75 h-50" src="https://i.pinimg.com/originals/9f/32/20/9f3220f4535dd9cd9743b995fdfdeaa1.jpg" />
                            <div className='card-body'>
                                Naman
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Home;
